                <h4 className="tela-inic">Nesta tela você irá cadastrar Cursos, períodos, Professores,
                Salas, Desafios, horários. 
                e suas Credenciais para criação de transaçõe</h4>
            </div>

        </div>
    )
}

export default Inicio;
